description:
Unused, recently completed self-build bike.
Unique combination of parts; rare steel frame with angular ; no decals except "Reynolds 631 main tubes" on seat tube; Raleigh Special Products logo is silver Ibis head in brush aluminium.
CAMPAGNOLO CENTAUR 10 ERGOPOWER LEVERS Carbon, new and unmarked; Tifosi Carbon Campagnolo Fit Bottom Bracket 102mm; CINELLI EUBIOS Handlebars 42cm in black with black bar tape; Shimano SPD M540 clipless pedals; Campagnolo Veloce 12-25 Cassette 10 speed; CAMPAGNOLO 2011 KHAMSIN G3 ROAD CYCLE BLACK WHEELS PAIR; CAMPAGNOLO ERGOPOWER ULTRASHIFT GEAR & BRAKE CABLESET; rear derailleur Campagnolo Chorus; chain rings Campagnolo Chorus; tyres Continental Gatorskins; tubes Vittoria 700c 19/23; bar front light mount; rear light mount on seatpost; chainstay protection in black insulating tape; cable rub protectors in black tape;

Vital stats:
Frame number : GM1B729 
Model : XTC Composite 29er 1 
Size: L (20ins)

Distinguishing features:
Easton EC70 carbon handlebar, with stock stem at -10deg;
Rockshox Reverb dropper seatpost;
Lezyne Alloydrive pump attached to Zefal spring cage;
Superstar component flat/skinny pedals - sort of grey/blue metallic;
Muckynutz mudguard at fork bridge;
Crudcatcher behind seat;
Clear helitape on major tubes, with some scratched paint below on top tube and this tape has been distorted a bit towards seatpost;
Black rubber self-annealing bike tape stuff on BOTH chainstays - non-driveside is slightly damaged which this covers.

Otherwise bike is more-or-less stock and obvious bits are:
Fork: Fox FLOAT F29 RL Evolution w/ 15mm Thru Axle, Tapered Steerer, 100mm 
Transmission: SRAM X7 2x10 
Cranks: Truvativ 26/39 
Brakes: Avid Elixir 1 180mm(f) 160mm(r)
Wheelset: Giant P-XC29-2 
Tyres: Schwalbe Racing Ralph 2.1

HPR Suspension;

Shimano Equipped

White mountain bicycle;

Black handle bar.

Black pedal and chains

Easton EA50 riser bar, black;
Lizard Skins lock-on grips, black;
Shimano XT front wheel quick release skewer;
Minecraft sticker on the top tube;
Rear wheel slightly untrued.

There are two numbers on the frame under the bottom bracket. One of them is the unique frame number which reads "IEC50100513" while the other is perpendicular to the frame number and reads "G71696M03". However, the latter does NOT seem to be unique and only the former should be considered as the unique frame number. Both can be seen in one of the photos.

